use std::cmp::Ordering;

struct Pair {
    left: Val,
    right: Val,
}
impl Pair {
    fn new(left: Val, right: Val) -> Pair {
        return Pair {
            left: left,
            right: right,
        };
    }
}

#[derive(Clone, Debug)]
enum Val {
    Number(u8),
    List(Vec<Val>),
}
impl Ord for Val {
    fn cmp(&self, other: &Self) -> Ordering {
        return compare(self.clone(), other.clone());
    }
}
impl PartialOrd for Val {
    fn partial_cmp(&self, other: &Self) -> Option<Ordering> {
        Some(self.cmp(other))
    }
}
impl PartialEq for Val {
    fn eq(&self, other: &Self) -> bool {
        return match self.cmp(other) {
            Ordering::Equal => true,
            _ => false,
        }
    }
}

impl Eq for Val { }

fn compare_vector(left: Vec<Val>, right: Vec<Val>) -> Ordering {
    for i in 0..std::cmp::min(left.len(), right.len()) {
        match compare(left[i].clone(), right[i].clone()) {
            Ordering::Less => return Ordering::Less,
            Ordering::Greater => return Ordering::Greater,
            Ordering::Equal => (),
        }
    }
    return left.len().cmp(&right.len());
}

fn compare(left: Val, right: Val) -> Ordering {
    match (left.clone(), right.clone()) {
        (Val::Number(l), Val::Number(r)) => l.cmp(&r),
        (Val::Number(_), Val::List(_)) =>
            compare(Val::List(vec!(left)), right),
        (Val::List(_), Val::Number(_)) =>
            compare(left.clone(), Val::List(vec!(right.clone()))),
        (Val::List(l), Val::List(r)) => compare_vector(l, r),
    }
}

